    "2016-09-03T03:41:36.326694",nt"name": "transroad-lrs2002",nt"isopen":
    false,nt"url": null,nt"notes": "LRS2002 is a Linear Referencing System
    layer that includes interstate, U.S., state (VT), and other transportation routes
    logged by the Vermont Agency of Transportation. These routes are represented in
    the ETE and TWN route subclass. ETE stands for End-to-End route system, meaning
    that routes increment from start to finish without resetting at town boundaries.
    TWN stands for Town-Based route system, meaning that routes increment from start
    to finish within each town, resetting at town boundaries. Linework and attributes
    were extracted from TransRoad_RDS (May 2002 version).",nt"license_title": null,nt"extras":
